INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (100, 0, 91002, "", 40000, 0, 36, 1, 0, "", 8);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (150, 0, 91002, "今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", 40001, 107501, 37, 1, 1, "ぺコリーヌ", 8);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (150, 0, 91002, "この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", 40001, 107601, 38, 2, 1, "コッコロ", 8);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (150, 0, 91002, "あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", 40001, 107801, 39, 3, 1, "キャル", 8);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (150, 0, 91002, "あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", 40001, 107701, 40, 4, 1, "スズメ", 8);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (150, 0, 91002, "今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", 40001, 107901, 41, 5, 1, "タマキ", 8);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (150, 0, 91002, "う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", 40001, 107501, 42, 6, 2, "ぺコリーヌ", 8);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (150, 0, 91002, "夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", 40001, 107601, 43, 7, 2, "コッコロ", 8);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (150, 0, 91002, "ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", 40001, 107801, 44, 8, 2, "キャル", 8);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (150, 0, 91002, "あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", 40001, 107701, 45, 9, 2, "スズメ", 8);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (150, 0, 91002, "夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", 40001, 107901, 46, 10, 2, "タマキ", 8);
