INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (1, 0, 24001, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 40011, 125801, 321, 1, 1, "リリ", 2);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (1, 0, 24001, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 40011, 126001, 322, 2, 1, "クリア", 2);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (1, 0, 24001, "んーと。\nこれ、あげる。\nはい", 40011, 126101, 323, 3, 1, "プレシア", 2);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (1, 0, 24001, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 40011, 125801, 324, 4, 2, "リリ", 2);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (1, 0, 24001, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 40011, 126001, 325, 5, 2, "クリア", 2);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (1, 0, 24001, "お兄。\nきてくれて、うれしい", 40011, 126101, 326, 6, 2, "プレシア", 2);
